import React from 'react'

function Data() {
  return (
    <div className='home_data'>
        <h1 className='home_title'>WELCOME TO</h1>
        <h2 className='home_subtitle'>EUNMI's</h2>
        <p className='home_description'>PORTFOLIO</p>

        <a href='#contact' className='button  '>Contact Shortcut</a>
    </div>
  )
}

export default Data
